Vieni internautai juokavo, kad nepaisant viso pasiruošimo, žiema kelininkus vėl užklupo netikėtai ir dalijosi šmaikščiais paveikslėliais. Kiti piktinosi, kad kelininkams niekada neužteks pinigų ir po orų išdaigų gatvės visada bus slidžios, kėlė nuotraukas su automobilių spūstimis. „Kelininkai yra laimingi žmonės, jiems kiekviena diena yra siurprizas“, – rimtai juokavo viešųjų ryšių ekspertas  Arijus Katauskas . Komentuodamas rytinius orus žurnalistas  Andrius Tapinas  atkreipė dėmesį, kad ši tema vienija žmones: „ Plikledis  yra didysis tautos vienytojas. Didesnis už Basanavičių ir Mažylį kartu sudėjus. Prireikė tik dviejų valandų, kad visi suprastų, jog dzin į ką atsitrenksi nesuvaldęs mašinos Gedimino prospekte – į Vytį ar į bunkerį.“ Didžiulė diskusija užvirė po Vilniaus mero Remigijaus Šimašiaus atsiprašymu asmeninėje feisbuko paskyroje. „Atsiprašau, kad ant grėblio užlipau kažkelioliktą kartą“, „Feisbuke nėra funkcijos kelių valymas“, „Gal pradėkite barstyti, ar lauksite, kol bus nulis“, – tokiais ir panašiais pasakymais reagavo internautai. Tačiau apžvalgininkas  Romas Sadauskas-Kvietkevičius  atkreipė dėmesį, kad atsiprašė tik sostinės vadovas, nors plikledis buvo ir kitose savivaldybėse. Grupė Kauno apskrities bendruomenės pareigūnai savo įrašu netgi kvietė žymėti draugus, kuriems patartumėte nevažiuoti automobiliu kai plikledis. Ekonomistas  Nerijus Mačiulis  replikavo, kad plikledis nėra didžiausia Lietuvos problema, nes šalies konkurencingumas šlubuoja. (function(d, s, i, r) {
